INSERT INTO `mst_cobc_question` (`question_id`, `question_text_eng`, `question_text_bhs`, `question_option_1_eng`, `question_option_1_bhs`, `question_option_2_eng`, `question_option_2_bhs`, `question_option_3_eng`, `question_option_3_bhs`, `question_answer`, `created_by`, `created_at`, `updated_by`, `updated_at`, `deleted_by`, `deleted_at`) VALUES
(1, 'You notice frequent financial transactions such as loans / money borrowing among colleagues or joint trades in stock market etc. among your supervisor and team members.  You will:', 'Anda sering melihat transaksi keuangan seperti memberi pinjaman/ pinjam meminjam uang di antara teman atau perdagangan di pasar saham, dll. Di antara supervisor dan anggota tim Anda. Anda akan:', 'Ignore this as these are of personal in nature.', 'Mengabaikan, karena ini adalah masalah pribadi dan sudah umum.', 'Report to your Level II supervisor considering it to be a case of conflict of interest.', 'Melaporkan kepada atasan mempertimbangkan ini akan menjadi konflik kepentingan.', 'Ask your colleague to include you in the group as these are team building activities.', 'Meminta teman Anda agar dimasukkan kedalam grup karena ini bagian dari aktifitas team building.', 2, 'Husin', '2020-09-07 08:53:21', 'Husin', '2020-09-07 15:36:55', NULL, NULL),
(2, 'Your relative is keen on starting a family business unrelated to Wipros business and wants to make you an active partner in the same. You will:', 'Saudara Anda akan memulai bisnis keluarga yang tidak memiliki hubungan dengan Wipro dan meminta Anda menjadi bagian/mitra aktif darinya. Anda akan:', 'Decline to become a partner since active participation in business together with employment would be a case of conflict of interest.', 'Menolak menjadi bagian/mitra aktif perusahaan keluarga karena akan berdampak pada konflik kepentingan ', 'Become a partner as the family business is unrelated to Wipro\'s businesses, henceforth, not required to inform Supervisor or HR for approval.', 'Menjadi bagian/mitra aktif perusahaan keluarga adalah tidak ada hubungannya dengan bisnis di Wipro oleh karena itu tidak perlu lapor dan meminta persetujuan kepada atasan dan HR ', 'Become a partner and subsequently inform your supervisor and HR Manager, since in your view there can be no conflict with Wipro.', 'Menjadi mitra/bagian dari perusahaan keluarga lalu lapor kepada atasan dan HR, karena menurut Anda tidak ada konflik keopentingan dengan Wipro ', 1, 'Husin', '2020-09-09 08:19:26', 'Husin', '2020-09-09 08:43:25', NULL, NULL),
(3, 'Assume your close relative is contesting for a political office. He requests that you campaign for him along with your colleagues. You will:', 'Anggap saudara Anda sedang memperebutkan jabatan politik. Dia meminta Anda berkampanye untuknya bersama rekan kerja  Anda. Anda akan:', 'Decline because this is not permissible as per Wipro\'s policy.', 'Menolak karena ini tidak dibenarkan dikebijakan Wipro', 'Believe that your relative is a very eligible candidate and that he will do good for his constituency. So you will request your colleagues and reportees to campaign and vote for him.', 'Percaya bahwa saudara Anda adalah kandidat kuat dan ia akan melakukan yang terbaik untuk daerah pemilihannya. Jadi, Anda akan meminta rekan kerja  dan bawahan Anda untuk berkampanye dan memilih dia.', 'Go ahead and campaign and decide to report once your relative wins the election.', 'Lanjut terus untuk ikut berkampanye dan memutuskan untuk melaporkan begitu saudara menang pemilihan ', 1, 'Husin', '2020-09-09 08:20:48', 'Husin', '2020-09-09 08:20:48', NULL, NULL),
(4, 'Your team member wants to offer gifts in the form of sweets / dry fruit packs / mooncakes to customers/suppliers for a festival or New Year.  You will:', 'Anggota tim Anda ingin memberikan hadiah dalam bentuk permen / buah kering / kue bulan kepada pelanggan / pemasok untuk festival atau Tahun Baru. Anda akan:', 'Advise him to proceed as gifting but on personal expenses.', 'Sarankan dia untuk melanjutkan sebagai hadiah tetapi atas biaya pribadi.', 'Advise him to proceed as per Wipro gift policy as a business courtesy for a festive is permissible. He should be reminded that the value shall not exceed acceptable limit of USD 50 (All countries except US & UK) or USD 100 (US & UK).', 'Sarankan dia untuk melanjutkan sesuai kebijakan hadiah Wipro sebagai izin bisnis untuk hari raya diperbolehkan. Dia harus diingatkan bahwa nilainya tidak boleh melebihi batas yang dapat diterima sebesar USD 50 (Semua negara kecuali AS & Inggris) atau USD 100 (AS & Inggris).', 'Advise him to ask Wipro\'s contractors / suppliers / consultants to issue the gifts and claim as \'other expenses\' in their invoices.', 'Sarankan dia untuk meminta kontraktor / pemasok / konsultan Wipro untuk mengeluarkan hadiah dan mengklaim sebagai \'pengeluaran lain\' dalam faktur mereka.', 2, 'Husin', '2020-09-09 08:20:48', 'Husin', '2020-09-09 08:20:48', NULL, NULL),
(5, 'A client\'s Procurement Manager unofficially informs you that Wipro has been selected as the \'preferred vendor\'. The Procurement Manager then requests for you to provide sports matches tickets for his company.  You will:', 'Klien  dari Procurement Manager secara tidak resmi memberi tahu Anda bahwa Wipro telah dipilih sebagai \'vendor pilihan\'. Procurement Manager kemudian meminta Anda untuk menyediakan tiket pertandingan olahraga untuk perusahaannya. Anda  akan:', 'Politely decline the request since providing such favors will breach Wipro\'s business relationship policy.', 'Menolak permintaan dengan sopan karena memberikan bantuan semacam itu akan melanggar kebijakan hubungan bisnis Wipro.', 'Provide the client with sports matches tickets using your own funds as you are keen to enhance relationship with the client.', 'Memberikan tiket pertandingan olah raga kepada klien dengan menggunakan dana Anda sendiri karena Anda ingin meningkatkan hubungan dengan klien.', 'Provide the client with sports matches tickets using your own funds and later claim from the Company as reimbursement of conveyance / stationary expenses.', 'Memberikan tiket pertandingan olah raga kepada klien dengan menggunakan dana Anda sendiri dan kemudian klaim ke Perusahaan sebagai penggantian biaya transportasi / alat tulis.', 1, 'Husin', '2020-09-09 08:20:48', 'Husin', '2020-09-09 08:20:48', NULL, NULL),
(6, 'You wish to engage a broker/middleman to secure a contract. You are aware of the fact that the broker/middleman was involved in a bribery case. You will:', 'Anda ingin bekerjasama melalui broker / perantara untuk penyediaan tenaga kontrak. Anda tahu bahwa faktanya pihak broker /perantara terlibat dalam kasus suap. Anda akan:', 'Engage the broker/middleman without fact finding as what happened was in the past.', 'Kerjasama dengan broker / perantara tanpa mencari fakta seperti apa yang terjadi di masa lalu.', 'Engage the broker/middleman first before informing to manager.', 'Kerjasama dengan broker / perantara terlebih dahulu tanpa memberi tahu manajer.', 'Initiate a thorough research on the broker/middleman\'s reputation and conduct in consulation with Legal/ HR  before deciding to engage.', 'Lakukan penyelidikan menyeluruh tentang reputasi broker / perantara dan lakukan konsultasi dengan Hukum / SDM sebelum memutuskan untuk bekerjasama.', 3, 'Husin', '2020-09-09 08:20:48', 'Husin', '2020-09-09 08:20:48', NULL, NULL),
(7, 'You represent Wipro in a contract negotiation. Before the award of the contract, the representative expressed desires to visit Wipro\'s manufacturing facility and expects Wipro to bear the cost of his travel and accommodation.  You will:', 'Anda mewakili Wipro dalam negosiasi kontrak. Sebelum pemberian kontrak, perwakilan menyatakan keinginan untuk mengunjungi fasilitas pabrik Wipro dan mengharapkan Wipro untuk menanggung biaya perjalanan dan akomodasi. Anda akan:', 'Agree to the request to enhance the chances of award of the contract.', 'Setuju dengan permintaan untuk meningkatkan peluang pemberian kontrak.', 'Politely decline the request for cost of travel and accommodation while agreeing to invite him to visit our manufacturing facility at his cost.', 'Dengan sopan menolak permintaan untuk biaya perjalanan dan akomodasi sambil setuju untuk mengundangnya mengunjungi fasilitas pabrik Wipro atas biayanya sendiri.', 'Advise Wipro\'s distributor / stockist to bear the cost of travel and accommodation and offer additional discounts to them to cover the costs.', 'Menyarankan distributor/agen Wipro untuk menanggung biaya perjalanan dan akomodasi dan menawarkan diskon tambahan kepada mereka untuk menutupi biaya.', 2, 'Husin', '2020-09-09 08:20:48', 'Husin', '2020-09-09 08:20:48', NULL, NULL),
(8, 'Wipro must obtain permission from a local authority to occupy a new office premise.  The consultant engaged for obtaining approval suggests that you give an expensive gift to the approving officer to speed up the approval process.  You will:', 'Wipro harus mendapatkan izin dari pemerintah setempat untuk menempati kantor baru. Konsultan yang dilibatkan untuk mendapatkan persetujuan menyarankan agar Anda memberikan hadiah mahal kepada petugas yang menyetujui untuk mempercepat proses persetujuan. Anda akan:', 'Negotiate with the consultant and agree to pay for the gift with your own funds since getting the permission is critical for the business.', 'Bernegosiasi dengan konsultan dan setuju untuk membayar hadiah dengan dana Anda sendiri karena mendapatkan izin sangat penting untuk bisnis.', 'Advise the consultant to offer the gift and ask him to bill us as \'miscellaneous expenses\'.', 'Menyarankan konsultan untuk menawarkan hadiah dan memintanya untuk menagih ke Wipro sebagai \'biaya lain-lain\'.', 'Decline the suggestion to offer the gift and advise him to pursue the application on merits.', 'Menolak sarannya untuk memberikan hadiah dan menasihatinya untuk mengerjakan proses sesuai prosedur.', 3, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(9, 'You just learnt that your close colleague is accused of sexual harassment and an investigation is being launched against him. Do you think that you have a responsibility as a friend to tell him?', 'Anda baru tahu bahwa teman dekat Anda dituduh melakukan pelecehan seksual dan penyelidikan sedang dilakukan terhadapnya. Apakah Anda berpikir bahwa Anda memiliki tanggung jawab sebagai teman untuk memberitahunya?', 'Yes, I think its only fair that I give my friend an advance warning or a heads up so that he can defend himself.', 'Ya, saya pikir itu akan adil jika saya memberi teman saya peringatan terlebih dahulu atau sebagai update sehingga ia dapat membela diri.', 'No, but Ill inform other team members about this.', 'Tidak, tetapi saya akan memberi tahu anggota tim lain tentang hal ini', 'No, I will not tell my colleague as it will interfere with the impartiality of the investigation. He will be given the opportunity to respond to these allegations and every effort will be made to conduct a fair and impartial investigation.', 'Tidak, saya tidak akan memberi tahu teman saya karena hal itu akan mengganggu independensi penyelidikan. Dia akan diberi kesempatan untuk menanggapi tuduhan ini dan segala upaya akan dilakukan untuk melakukan penyelidikan yang adil dan tidak memihak.', 3, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(10, 'Your supervisor repeatedly asks you out for a drink, makes comments about your appearance that makes you feel uncomfortable and cracks sexist jokes which creates a hostile environment. What will you do during such a situation?', 'Atasan Anda berulang kali meminta Anda untuk pergi bersama serta membuat komentar tentang penampilan Anda yang membuat Anda merasa tidak nyaman dan membuat lawakan yang cabul  sehingga menciptakan lingkungan kerja  yang saling bersitegang. Apa yang akan Anda lakukan dalam situasi seperti itu?', 'It is better that you laugh at his jokes since the supervisor will rate your performance.', 'Lebih baik ikut menertawakan leluconnya karena atasan akan memberikan penilaian kinerja untuk Anda.', 'Ideally tell your supervisor that you are uncomfortable and such actions are inappropriate and must be stopped.  In a situation which you are uncomfortable to inform supervisor and if he continues, you will report the problem to HR or the Ombuds person.', 'Sebaiknya beri tahu atasan Anda bahwa Anda merasa tidak nyaman dan tindakan seperti itu tidak pantas dan harus dihentikan. Dalam situasi di mana Anda merasa tidak nyaman untuk memberi tahu atasan dan jika dia melanjutkan, Anda akan melaporkan masalahnya kepada HR atau Ombuds.', 'Keep quiet and ignore such actions.', 'Diam dan abaikan tindakan seperti itu.', 2, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(11, 'A vendor offers your colleague an expensive gift. The colleague consults you on what must be done. You will:', 'Vendor menawarkan hadiah mahal kepada teman Anda. teman itu berkonsultasi dengan Anda tentang apa yang harus dilakukan. Anda akan:', 'Ask the colleague to do as he pleases.', 'Minta teman untuk melakukan apa yang dia mau.', 'Advise him to retain the gift as there is no financial impact for Wipro.', 'Menyarankan dia untuk menerima hadiah tersebut karena tidak ada dampak finansial bagi Wipro.', 'Advise him to follow what is advised in the Gifts & Entertainment Policy of COBCE.', 'Menyarankan dia untuk mengikuti apa yang disarankan dalam Kebijakan Hadiah & Hiburan didalam COBCE', 3, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(12, 'A critical and high value customer/ distributor asks you to offer a donation to a renowned charitable organization. The customer/ distributor has a clear policy on its website that requests all its vendors\' support in the charitable causes. You will:', 'Pelanggan / distributor yang penting meminta Anda untuk memberikan donasi kepada organisasi amal yang terkenal. Pelanggan / distributor memiliki kebijakan yang jelas di situs webnya yang meminta dukungan semua vendornya untuk tujuan amal. Anda akan:', 'Commit to contribute before putting in an internal request as it would help a charitable cause and help secure future businesses.', 'Berkomitmen untuk berkontribusi sebelum mengajukan permintaan internal karena akan membantu tujuan amal dan membantu mengamankan bisnis di masa depan.', 'Inform Wipro\'s Legal & Compliance department to assess the request and advise.', 'Menginformasikan departemen Hukum & Kepatuhan Wipro untuk menilai permintaan dan saran tersebut.', 'Agree to make the contribution from your personal funds and seek reimbursement later.', 'Setuju untuk memberikan kontribusi dari dana pribadi Anda dan mencari penggantinya nanti.', 2, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(13, 'You are responsible for the construction of the Company\'s new office. The building is ready in all aspects except the occupancy certificate from local authority, which is still pending. Business team wants to occupy the building. You will:', 'Anda bertanggung jawab atas pembangunan kantor baru Perusahaan. Bangunan siap dalam semua aspek kecuali ijin tinggal dari pemerintah setempat yang masih tertunda. Tim ingin menempati gedung. Anda akan:', 'Engage a consultant to obtain the occupancy certificate fast even if a bribe is required to be paid to facilitate the business.', 'Libatkan seorang konsultan untuk mendapatkan ijin tinggal dengan cepat, bahkan jika perlu berikan uang suap untuk memfasilitasi bisnis.', 'Inform business team that building cannot be occupied before obtaining occupancy certificate.', 'Beri tahu tim bahwa bangunan tidak dapat ditempati sebelum mendapatkan ijin tinggal.', 'Advise business team to go ahead and occupy as obtaining occupancy certificate is only a procedural requirement.', 'Menyarankan tim untuk terus maju dan menempati bangunan karena memperoleh ijin tinggal hanya persyaratan prosedural.', 2, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(14, 'You have applied for a municipal license / approval  for a Wipro factory with a Government authority. The officer handling the matter is ready to grant the license but is requesting you to hire his brother\'s firm to run our cafeteria. You will:', 'Anda telah mengajukan lisensi / persetujuan untuk pabrik Wipro dengan Pemerintah setempat. Petugas yang menangani ijin ini akan memberikan lisensi tetapi meminta Anda untuk bekerjasama dengan perusahaan saudaranya untuk menjalankan kantin di pabrik. Anda akan:', 'Request the officer to consider our license application on merits and inform him that his request for favour cannot be considered.', 'Minta petugas untuk mempertimbangkan permohonan lisensi berdasarkan pada prosedur yang ada dan memberitahunya bahwa permintaan bantuannya tidak dapat dipertimbangkan.', 'Ask the officer to first grant the license / permission and promise him that once granted the proposal to hire the firm will be forwarded to HR Department for certain consideration.', 'Meminta petugas untuk terlebih dahulu memberikan lisensi / izin dan berjanji kepadanya bahwa setelah mengabulkan proposalnya akan meneruskan permintaannya kepada Departemen SDM agar dapat terpenuhi pula.', 'Recommend the firm to HR Head to favourably consider since license / permission is critical for business.', 'Merekomendasikan kepada HR Head agar dipertimbangkan dengan baik karena linsesni/ijin sangat penting bagi perusahaan.', 1, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(15, 'Wipro is bidding for a new channel sales contract. The officer-in-charge asks you to favourably consider his son\'s job application for a post at Wipro. You will:', 'Wipro sedang mencari channel sales yang baru. Petugas yang berhubungan tersebut meminta Anda untuk mempertimbangkan lamaran pekerjaan putranya dengan baik untuk sebuah jabatan di Wipro. Anda akan:', 'Agree to the request of the officer-in-charge as you feel this will enhance chances of winning the large contract.', 'Setuju dengan permintaan petugas tersebut karena Anda merasa ini akan meningkatkan peluang memenangkan kontrak besar.', 'Ask the officer-in-charge to assure awarding of contract to Wipro and then send the job application to HR team with a strong recommendation.', 'Minta petugas yang bersangkutan untuk memastikan pemberian kontrak kepada Wipro dan kemudian mengirimkan lamaran kerja ke tim SDM dengan rekomendasi yang kuat.', 'Inform the officer-in-charge that the job application will be sent to HR department to consider on merits.', 'Memberi tahu petugas yang bersangkutan bahwa lamaran pekerjaan dapat dikirimkan langsung ke departemen SDM untuk proses sesuai prosedur recruitment', 3, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(16, 'Wipro is bidding for supply of products for national day parade. The procurement officer wants you to hire his son as consultant. You will:', 'Wipro mengajukan penawaran produk kepada instansi pemerintah. Petugas pengadaan barang dan jasa ingin Anda mempekerjakan putranya sebagai konsultan di Wipro. Anda akan:', 'Engage his son as consultant as securing the supply order is very important for meeting plan numbers.', 'Menjadikan putranya sebagai konsultan agar proyek pengadaan produk terpenuhi dan target sales tercapai', 'Inform the procurement officer that such request will not be accepted but we can send to HR for consideration on merits.', 'Beri tahu petugas bahwa permintaan semacam itu tidak sesuai dengan Wipro Spirit tetapi petugas dapat mengirimkan proposal ke HR agar mengikuti proses seleksi dengan benar', 'Promise the officer that it will be considered favourably but ignore it once the supply order is placed on us', 'Berjanji kepada petugas bahwa permintaan itu dapat dipenuhi perusahaan namun begitu order sudah didapat maka bisa diabaikan', 2, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(17, 'You are a sales person and have submitted a competitive bid for Wipro in response to a outlet space. The outlet\'s purchasing manager asks you to arrange for a dummy bid from a Wipro\'s distributor so that it satisfies the criteria of competitive bidding and will ensure award of the contract to Wipro. You will:', 'Anda adalah seorang sales dan telah mengajukan penawaran kompetitif untuk Wipro atas outlet. Manajer pembelian outlet meminta Anda untuk mengatur tawaran tiruan dari distributor Wipro sehingga memenuhi kriteria penawaran kompetitif dan akan memastikan pemberian kontrak kepada Wipro. Anda akan:', 'Immediately agree and reach out to some distributors to seek the dummy bids with a higher price so that selection of our bid is assured.', 'segera menyetujui dan menyampaikan ke distributor agar mencari tawaran rekaan dengan harga lebih tinggi sehingga pemilihan penawaran jatuh pada Anda', 'Seek further assurance from the purchasing manager that our bid will be selected and then work to secure the dummy bid.', 'Cari jaminan lebih lanjut dari manajer pembelian bahwa penawaran Anda akan dipilih dan kemudian bekerja untuk mengamankan penawaran tiruan.', 'Politely decline saying that this will amount to misrepresentation and will be against our Ethics Policy.', 'Menolak dengan sopan dan mengatakan bahwa ini akan menjadi catatan yang tidak baik dan bertentangan dengan keijakan etika Wipro', 3, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(18, 'You read in the newspapers that the distributor engaged by us has been convicted in a bribery case by local authorities. You will:', 'Anda membaca di surat kabar bahwa distributor yang bekerjasama dengan Anda telah dihukum dalam kasus suap oleh pemerintah  setempat. Anda akan:', 'Promptly report to Wipro\'s Legal & Compliance department and seek their advice.', 'Segera laporkan ke bagian Hukum & Kepatuhan Wipro dan minta saran mereka.', 'Disregard what you read and continue using the distributor until there is advisory to disengage with the distributor.', 'Abaikan apa yang Anda baca dan terus gunakan distributor sampai ada saran untuk mengganti distributor.', 'Continue using the distributor as he is highly successful in winning deals.', 'Terus menggunakan distributor karena ia sangat berhasil dalam penjualan.', 1, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(19, 'You find that some of your colleagues are submitting fake medical / travel expense bill.  You will :', 'Anda mengetahui bahwa beberapa rekan Anda mengirimkan tagihan biaya medis / perjalanan palsu. Anda akan :', 'Follow the act of colleagues since no one has reported it.', 'Mengikuti tindakan rekan kerja karena tidak ada yang melaporkannya.', 'Report to HR Manager or Ombudsperson.', 'Melaporkan ke Manajer SDM atau Ombudsman.', 'Will not paricipate in such act, and keep quiet to avoid uncessary trouble.', 'Tidak akan berpartisipasi dalam tindakan seperti itu, dan tetap diam untuk menghindari masalah yang tidak perlu.', 2, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(20, 'You developed a formulation/ design at Wipro but this was not used for any purpose. While leaving Wipro, a colleague advises you to take the blueprint as you are the one who have developed it. You will:', 'Anda mengembangkan formula/desain di Wipro tetapi tidak digunakan untuk tujuan apa pun. Saat meninggalkan Wipro, seorang rekan menyarankan Anda untuk mengambil master data karena Anda adalah orang yang mengembangkannya. Anda akan:', 'Take the formulation / design for use as after all it is designed and developed by you.                                ', 'Ambil formula/ desain untuk digunakan karena semuanya dirancang dan dikembangkan oleh Anda.', 'Not take it. Anything created within Wipro belongs to the intellectual property rights of Wipro.', 'Tidak mengambilnya. Apa pun yang dibuat dalam Wipro adalah hak kekayaan intelektual Wipro.', 'Take the formulation/design for commercial use as it is anyway not used at Wipro and therefore will not harm the interests of Wipro.', 'Ambil formula/desain untuk penggunaan komersial karena tidak digunakan di Wipro dan karena itu tidak akan membahayakan kepentingan Wipro.', 2, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(21, 'Your colleague has recently joined Wipro from a competitor company. You noticed that he has brought with him confidential material with IP rights (eg: formulation, design & logo) of previous company that he says is created by him in his previous employment. He wants to use it at Wipro for company\'s benefit. You will.', 'Teman Anda baru-baru ini bergabung dengan Wipro dari perusahaan pesaing. Anda memperhatikan bahwa ia telah membawa materi mengenai hak paten (misalnya: formula, desain & logo) perusahaan sebelumnya yang menurutnya dibuat olehnya dalam pekerjaan sebelumnya. Dia ingin menggunakannya di Wipro untuk keuntungan perusahaan. Anda akan.', 'Do not interfere as it is his decision.', 'Tidak ikut campur karena itu adalah keputusannya.', 'Advise him against the use and report this to your manager or Ombudsperson.', 'Menyarankan agar tidak menggunakan dan melaporkan hal ini kepada manajer atau Ombudsman.', 'Appreciate the colleague and encourage him to use it for Wipro\'s benefit.', 'Memberikan penghargaan dan mendukung dia untuk menggunakannya demi keuntungan Wipro.', 2, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(22, 'Our bottle supplier has provided us with our competitor\'s confidential skincare bottle design who he is also supplying too. He advised us to use the same design. You will:', 'Suplier  botol telah menyediakan kepada Anda desain botol perawatan kulit rahasia pesaing yang juga ia sediakan. Dia menyarankan Anda  untuk menggunakan desain yang sama. Anda akan:', 'Proceed with the suggestion as this will help us save resources in coming up with a new bottle design.', 'Mengikuti sarannya karena ini akan membantu Anda menghemat sumber daya dalam menghasilkan desain botol baru.', 'Proceed with the suggestion and will keep your supervisor informed of your action of copying the competitor\'s design.', 'Mengikuti sarannya dan memberi tahu atasan Anda tentang tindakan Anda menyalin desain pesaing.', 'Not use it as this will be a violation of Wipro\'s policy on confidentiality.', 'Tidak menggunakannya karena ini merupakan pelanggaran kebijakan Wipro tentang kerahasiaan.', 3, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(23, 'You are unable to complete the work assigned to you and you intend to work over the weekends to complete the task. As you do not have a laptop, your colleague advises you to forward the incomplete work to your personal email account and work at home. You will:', 'Anda tidak dapat menyelesaikan pekerjaan yang ditugaskan untuk Anda dan Anda bermaksud untuk bekerja selama akhir pekan untuk menyelesaikan tugas. Karena Anda tidak memiliki laptop, teman Anda menyarankan Anda untuk meneruskan pekerjaan yang tidak lengkap ke akun email pribadi Anda dan bekerja di rumah. Anda akan:', 'Follow your colleague\'s advice as this will help you to complete the task in time.', 'Ikuti saran teman karena ini akan membantu Anda menyelesaikan tugas tepat waktu.', 'Copy the material on a thumb drive instead of sending it to personal email account.', 'Salin materi pada thumb drive alih-alih mengirimnya ke akun email pribadi.', 'Not take the material by either transferring to personal email ID or through thumb drive since it will violate Wipro\'s confidentiality policy.', 'Tidak mengambil materi dengan mentransfer ke ID email pribadi atau melalui thumb drive karena itu akan melanggar kebijakan kerahasiaan Wipro.', 3, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(24, 'A start-up company manufacturing personal care products approaches you as a liaison consultant for technical support and advice in setting up manufacturing operations. The company\'s CEO, your friend, promises there will be no confllict to the work you do for him and will not affect your work at Wipro. The CEO needs your support only during weekends and holidays, and will pay consultant fee to you. You will:', 'Perusahaan startup yang memproduksi produk perawatan pribadi mendekati Anda sebagai konsultan untuk dukungan teknis dan saran dalam mengatur operasi manufaktur. CEO perusahaan, teman Anda, berjanji tidak akan ada konflik dengan pekerjaan yang Anda lakukan untuknya dan tidak akan memengaruhi pekerjaan Anda di Wipro. CEO hanya membutuhkan dukungan Anda selama akhir pekan dan hari libur, dan akan membayar biaya konsultan kepada Anda. Anda akan:', 'Accept the offer as it does not interfere with your work at Wipro.', 'Terima tawaran karena tidak mengganggu pekerjaan Anda di Wipro.', 'Decline the offer as this will result into conflict of interest and will breach Wipro\'s COBCE.', 'Tolak tawaran karena ini akan menimbulkan konflik kepentingan dan akan melanggar COBCE Wipro.', 'Accept the offer as part-time work since that company\'s CEO also offers to remunerate you.', 'Terima tawaran itu sebagai pekerjaan paruh waktu karena CEO perusahaan itu juga menawarkan imbalan bagi Anda.', 2, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(25, 'You have evidence that your supervisor has been sexually harassing some employees. You will:', 'Anda memiliki bukti bahwa atasan Anda telah melecehkan beberapa karyawan secara seksual. Anda akan:', 'Ignore it as your supervisor is very influential and could damage your career.', 'Abaikan saja karena atasan Anda sangat berpengaruh dan dapat merusak karier Anda.', 'Raise your concern with your Line 2 Manager, HR and / or the Ombudsperson.', 'Sampaikan kekhawatiran Anda dengan Manajer Anda, SDM dan / atau Ombudsman.', 'Share the information with your friends regarding the attitude of your Supervisor but not escalate the issue.', 'Bagikan informasi ini dengan teman-teman Anda mengenai sikap Supervisor Anda tetapi tidak mengeskalasi masalahnya.', 2, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(26, 'You were previously working for Wipro\'s key competitor. Your supervisor asks you to share the sales strategy plans and confidential information of your former employer. You will:', 'Anda sebelumnya bekerja untuk pesaing utama Wipro. Atasan Anda meminta Anda untuk membagikan rencana strategi penjualan dan informasi rahasia perusaahan Anda sebelumnya. Anda akan:', 'Share it with your supervisor and ask him / her to keep it confidential.', 'Bagikan dengan supervisor Anda dan minta dia merahasiakannya.', 'Politely refuse to share the information since the information is confidential to your former employer.', 'Menolak dengan sopan untuk membagikan informasi karena informasi tersebut hak perusahaan sebelumnya', 'Partially share the information without referencing the name of your previous employer.', 'Bagikan sebagian informasi tanpa merujuk nama perusahaan Anda sebelumnya.', 2, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-10 06:29:39', NULL, NULL),
(27, 'You find that your Business / Functional Head overlooks merits/ competencies and prefers to hire only from the particular religious community which s/he belongs to. You will:', 'Anda mengetahui bahwa  CEO/ HOD Anda mengabaikan kemampuan dan keunggulan dan lebih suka mempekerjakan hanya dari komunitas keagamaan tertentu yang menjadi miliknya. Anda akan:', 'Ignore such practice even though it violates Wipro\'s COBCE since you feel that it is the supervisor\'s choice.', 'Abaikan praktik seperti itu meskipun itu melanggar COBCE Wipro karena Anda merasa itu adalah pilihan Atasan.', 'Speak up your concern with the VP, HR and / or the Ombudsperson about this practice.', 'Sampaikan keprihatinan Anda dengan VP, HR, dan / atau Ombudsman tentang praktik ini.', 'Advise him on Equal Employment Opportunity laws and leave the matter there whether change in wrong practice is done or not.', 'Beri tahu dia tentang undang-undang Peluang Kerja yang Setara dan biarkan saja apakah selanjutnya ada perubahan dalam praktik atau tidak.', 2, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(28, 'To meet the quarterly sales target, you are asked to record a sale which will not take place by the time the quarter ends and will spill over to the next quarter. You will:', 'Untuk memenuhi target penjualan triwulanan, Anda diminta untuk mencatat penjualan yang tidak akan terjadi pada saat kuartal berakhir dan akan dimasukkan ke kuartal berikutnya. Anda akan:', 'Go ahead and record the sale.', 'Silakan saja mencatat penjualan.', 'Not record the sale considering the actual sale did not happen in that quarter and report the person who asked you to do this to the Ombudsperson since it amounts to misreporting of financials.', 'Tidak mencatat penjualan mengingat penjualan yang sebenarnya tidak terjadi pada kuartal itu dan melaporkan orang yang meminta Anda untuk melakukan ini kepada Ombudsman karena salah dalam pencatatan', 'Politely refuse the instruction and advise the person about the consequences but leave the final decision to such person and not to be bothered since you have not done anything wrong.', 'Dengan sopan menolak instruksi dan memberi tahu orang tersebut tentang konsekuensinya tetapi serahkan keputusan terakhir kepada orang tersebut dan jangan diganggu karena Anda tidak melakukan kesalahan apa pun.', 2, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(29, 'You have worked extra hours for Wipro to meet the urgent supply order of your retailer for a major roadshow. The customer, in recognition of this exemplary performance, offers you a fully paid vacation trip with family. You will:', 'Anda telah bekerja lebih dari waktu yang ada untuk Wipro guna memenuhi pesanan pasokan mendesak dari pengecer Anda untuk program roadshow. Pelanggan, memberikan kepada Anda perjalanan liburan yang dibayar penuh dengan keluarga sebagai bentuk penghargaan. Anda akan:', 'Accept the offer and write a polite thank you email with a copy to your supervisor.', 'Terima tawaran itu dan tulis email terima kasih yang sopan dengan tembusan kepada atasan Anda.', 'Refuse the offer as it violates the Business Relationship Policy of Wipro.', 'Menolak tawaran itu karena melanggar Kebijakan Hubungan Bisnis Wipro.', 'Accept the offer first then inform your supervisor.', 'Terima tawaran terlebih dahulu kemudian informasikan kepada atasan Anda.', 2, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(30, 'Your uncle, who runs a cab services company is bidding to be the cab service provider in Wipro. You are in the decision making position. You will:', 'Paman Anda, yang menjalankan perusahaan jasa taksi, menawarkan untuk menjadi penyedia layanan taksi di Wipro. Anda berada dalam posisi mengambil keputusan. Anda akan:', 'Disclose the conflict to your supervisor and withdraw from the decision making process.', 'Mengungkapkan konflik kepada atasan Anda dan menarik diri dari proses pengambilan keputusan.', 'Act impartially and decide to award the contract to the party with the most favorable terms.', 'Bertindak tidak memihak dan memutuskan untuk memberikan kontrak kepada pihak dengan penawaran yang paling menguntungkan.', 'Participate in the decision making process to hire your Uncle\'s company.', 'Berpartisipasilah dalam proses pengambilan keputusan untuk mempekerjakan perusahaan Paman Anda.', 1, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(31, 'You noticed that your colleague has been receiving obscene/ threatening emails from another colleague but has never complained. You will:', 'Anda memperhatikan bahwa teman  Anda telah menerima email cabul / mengancam dari teman lain tetapi tidak pernah mengeluh. Anda akan:', 'Ask your colleague to forward the emails to you.', 'Minta rekan Anda untuk meneruskan email kepada Anda.', 'Ignore the matter since it is not bothering you.', 'Abaikan masalah ini karena itu tidak mengganggu Anda.', 'Advise the colleague to raise the concern with the Function Head / HR / Ombudsperson. Alternatively you can also raise it up anoynomously.', 'Menyarankan teman tersebut untuk menyampaikan kekhawatirannya kepada Function Head / HR / Ombudsperson. Atau Anda juga dapat menaikkannya secara anoynomously.', 3, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(32, 'Your male colleague has a team that consists of only male members. On a recruitment visit to a local college, he elaborates to the team why he refuses to have female members on his team. You will:', 'Teman pria Anda memiliki tim yang hanya terdiri dari anggota pria. Pada kunjungan rekrutmen ke perguruan tinggi setempat, ia menjelaskan kepada tim mengapa ia menolak untuk memiliki anggota perempuan di timnya. Anda akan:', 'Ignore it as the male colleague is very influential and could harm your career.', 'Abaikan saja karena rekan pria sangat berpengaruh dan bisa membahayakan karier Anda.', 'Report the conversation to your supervisor, VP, HR, and /or the Ombudsperson since it is a case of biased and discriminatory hiring which is against Wipro\'s policy of fair and equal employment opportunities.', 'Laporkan percakapan  tersebut kepada atasan Anda, CEO, SDM, dan / atau Ombudsman karena ini adalah kasus perekrutan yang bias dan diskriminatif yang bertentangan dengan kebijakan Wipro tentang peluang kerja yang adil dan setara.', 'Not interfere in the recruitment process since you have not done anything wrong.', 'Tidak ikut campur dalam proses rekrutmen karena Anda tidak melakukan kesalahan.', 2, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(33, 'Government representatives was doing a plant tour of the manufacturing facilities. At the end of the tour, the government representatives request to be gifted with cartons of company products that he can bring back for his team members. You will:', 'Perwakilan pemerintah sedang melakukan tur pabrik fasilitas manufaktur. Pada akhir tur, perwakilan pemerintah meminta untuk diberi karton produk perusahaan yang dapat ia bawa kembali untuk anggota timnya. Anda akan:', 'Agree to the request as a form of sponsorship. ', 'Setujui permintaan sebagai bentuk sponsor.', 'Inform the government representative that a gift hamper of company products was prepared as business courtesy. However, if cartons of company products is requested, it will be charged at the cost price instead of gifting. ', 'Beri tahu perwakilan pemerintah bahwa hadiah produk perusahaan disiapkan sebagai penghargaan tamu. Namun, jika meminta berupa/sebanyak karton produk perusahaan itu akan dibebankan pada harga biaya daripada pemberian.', 'Arrange distributor to send company products on behalf and claim from company as expenses. ', 'Atur distributor untuk mengirim produk perusahaan atas nama dan klaim dari perusahaan sebagai biaya.', 2, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(34, 'You find that your team members are regularly sharing the passwords of their laptops, SAP and other secure processes.  You will:', 'Anda menemukan bahwa anggota tim Anda secara teratur membagikan password laptop mereka, SAP dan password yang lain. Anda akan:', 'Not engage in it but will ignore the same.', 'Tidak terlibat di dalamnya tetapi akan mengabaikan hal yang sama.', 'Alert your colleagues about our Password Policy and report to Ombudsperson.', 'Beri tahu teman Anda tentang Kebijakan password dan laporkan ke Ombudsperson.', 'Participate in the practice as you find that this is very effective at workplace.', 'Ikut dalam praktik karena ini akan menjadikan kerja lebih efektif', 2, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-10 06:29:53', NULL, NULL),
(35, 'You are an active social media user and intend to also start blogging.  You will:', 'Anda adalah pengguna media sosial aktif dan berniat untuk juga memulai blogging. Anda akan:', 'Post information about Wipro\'s customers and deal wins.', 'Posting informasi tentang pelanggan Wipro dan ketentuan lainnya.', 'Post information about the work we do for our customers.', 'Posting informasi tentang pekerjaan yang Anda lakukan untuk pelanggan.', 'Keep your views and comments generic in nature without revealing information of Wipro\'s customers, deal wins or the work Wipro do for customers. You will not act as an authorized spokeperson of the company.', 'Pertahankan pandangan dan komentar Anda secara umum tanpa mengungkapkan informasi pelanggan Wipro, menang, atau pekerjaan yang Wipro lakukan untuk pelanggan. Anda tidak akan bertindak sebagai juru bicara resmi perusahaan.', 3, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(36, 'You are making a sales presentation to a prospective customer. You wish to include names / logos of current Wipro customers.  You will:', 'Anda membuat presentasi penjualan kepada calon pelanggan. Anda ingin memasukkan nama / logo pelanggan Wipro saat ini. Anda akan:', 'Take clearance from Marketing / Sales Team, who will take approvals from the customers for use of their names / logos.', 'Minta izin dari Tim Pemasaran / Penjualan untuk penggunaan nama / logo mereka.', 'Use customer names / logos since it is only in the form of a PPT and no handout will be given to prospective customer.', 'Gunakan nama / logo pelanggan karena hanya dalam bentuk PPT dan tidak akan diberikan handout kepada calon pelanggan.', 'Proceed with your proposal as you\'re only stating the truth.', 'Lanjutkan dengan proposal Anda karena Anda hanya menyatakan kebenaran.', 1, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(37, 'One of your suppliers offered you a restaurant coupon for your personal use as a goodwill gesture for choosing to work with them. You will :', 'Salah satu suplier Anda menawarkan voucher restoran untuk penggunaan pribadi Anda sebagai isyarat niat baik untuk memilih bekerja dengan mereka. Anda akan :', 'Take it and use it.', 'Ambil dan gunakan', 'Politely decline it as it conflicts with Wipro\'s Policy and Code of Business Conduct. If it is already received, you will hand it over to HR for shared pool and inform the supplier.', 'Menolak dengan sopan karena bertentangan dengan Kebijakan Wipro dan Kode etik bisnis. Jika sudah terlanjur diterima, Anda akan menyerahkannya ke HR untuk dikumpulkan bersama dan memberi tahu suplier.', 'Take it and offer it to your friend so that you dont breach the policy on Gifts, Entertainment & Business Courtesies.', 'Terima dan tawarkan kepada teman Anda sehingga Anda tidak melanggar kebijakan tentang Hadiah, Hiburan & Pemberian Bisnis.', 2, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(38, 'You want to volunteer for a NGO near your house that is engaged in teaching school children. You will :', 'Anda ingin menjadi sukarelawan untuk sebuah LSM di dekat rumah Anda yang bergerak dalam bidang pengajaran anak sekolah. Anda akan :', 'Volunteer without seeking approval from your supervisor or HR, as you know Wipro supports educational initiatives for children.', 'Menjadi sukarelawan tanpa meminta persetujuan dari supervisor atau HR Anda, karena Anda tahu Wipro mendukung inisiatif pendidikan untuk anak-anak.', 'Accept to volunteer on a \'no remuneration basis\' with approval from your supervisor or HR.', 'Terima untuk menjadi sukarelawan \'tanpa imbalan\' dengan persetujuan dari supervisor atau HR Anda.', 'Volunteer and charge a token fee to ensure that the NGO values your contribution.', 'Menjadi sukarelawan dan memungut bayaran untuk memastikan bahwa LSM menghargai kontribusi Anda.', 2, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(39, 'An employee wants to resign. His manager threatens to give a negative feedback to the next organization if he resigns. What should this employee do?', 'Seorang karyawan ingin mengundurkan diri. Manajernya mengancam akan memberikan referensi yang buruk kepada organisasi berikutnya jika dia mengundurkan diri. Apa yang harus dilakukan karyawan ini?', 'Continue employment with Wipro as he does not wish to have a negative feedback on his record.', 'Lanjutkan pekerjaan dengan Wipro karena dia tidak ingin mendapatkan referensi buruk ', 'Report to HR.', 'Laporkan kepada HR', 'Try to offer a gift to the Manager so that he provides a positive feedback.', 'Cobalah untuk menawarkan hadiah kepada Manajer agar dia memberikan umpan balik yang positif.', 2, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(40, 'You have been called up by HR for inquiries to assist on a COBCE violation investigation. You will:', 'Anda telah dipanggil oleh HR untuk mendapatkan pertanyaan guna membantu penyelidikan pelanggaran COBCE. Anda akan:', 'Refrain from sharing any facts or information as you do not wish to get anyone into trouble.', 'Jangan membagikan fakta atau informasi apa pun karena Anda tidak ingin membuat siapa pun mendapat masalah.', 'Share the facts on your awareness to the investigation panel without withholding information or giving false or misleading information.', 'Sampaikan fakta sepanjang yang Anda tahu/pahami kepada panel investigasi tanpa menyembunyikan informasi atau memberikan informasi yang salah atau menyesatkan.', 'Share the facts on your awareness to the investigation panel but withhold information which may get others into trouble.', 'Sampaikan fakta tentang apa yang Anda tahu kepada panel investigasi tetapi sembunyikan informasi yang dapat membuat orang lain mendapat masalah.', 2, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(41, 'A manager makes his team member run his personal needs and threatens if the employee refuses. Can the employee take any action?', 'Seorang manajer meminta anggota timnya menjalankan apa yang menjadi kepentingan pribadinya dan mengancam jika karyawan tersebut menolak. Bisakah karyawan tersebut mengambil tindakan?', 'Yes, the employee can raise a concern with the HR or Ombuds.', 'Ya, karyawan tersebut dapat melaporkan kepada HR atau Ombuds.', 'No, this may affect his career.', 'Tidak akan melaporkan karena ini akan berdampak pada karirnya', 'No, this is only a trivial matter, the employee need not raise any concern or complaint against the manager.', 'Tidak, ini hanya masalah sepele, karyawan tidak perlu menyampaikan kekhawatiran atau keluhan apa pun terhadap manajer.', 1, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(42, 'A female employee raises concern with you that the warehouse/ sales office where she is located has a common washroom (shared between male and female employees) as the number of female employees is low. You will:', 'Seorang karyawan wanita menyampaikan konsennya kepada Anda bahwa gudang / kantor penjualan tempat dia berada memiliki kamar kecil yang umum (digunakan bersama antara karyawan pria dan wanita) karena jumlah karyawan wanita sedikit. Anda akan:', 'Ignore the concern since this is the problem of the female employee and advise her to handle on her own.', 'Abaikan konsennya karena ini adalah masalah karyawan wanita tersebut dan sarankan dia untuk menangani sendiri.', 'Advise the female employee to adjust and not to raise such minor issues since it may be viewed as a case of indiscipline on the part of the female employee.', 'Sarankan karyawan wanita untuk menyesuaikan dan tidak mengangkat masalah kecil seperti itu karena hal itu dapat dipandang sebagai kasus ketidakdisiplinan di pihak karyawan wanita.', 'Advise the female employee to take up the matter with the location head and HR team immediately on the concern for employee privacy and safety. ', 'Sarankan karyawan wanita tersebut untuk segera menangani masalah ini dengan kepala lokasi dan tim HR tentang masalah privasi dan keselamatan karyawan.', 3, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(43, 'Through an audit, a procurement manager becomes aware of the fact that one of our vendors who provides contract employees is paying less than the legislated social contribution to his employees. What can he do? ', 'Melalui audit, manajer procurement menyadari fakta bahwa salah satu vendor kita yang menyediakan karyawan kontrak membayar BPJS kurang dari yang diatur undang-undang . Apa yang dapat dia lakukan?', 'He should ignore the audit findings as the payroll of the vendors employees is not his concern.', 'Dia harus mengabaikan temuan audit karena penggajian karyawan vendor bukan urusannya.', 'Take action as the policy requires Wipro to ensure that all its suppliers comply with all applicable labour laws.', 'Ambil tindakan karena kebijakan tersebut mengharuskan Wipro memastikan bahwa semua suplier/vendor mematuhi semua undang-undang ketenagakerjaan yang berlaku.', 'Contract employees are on the payroll of the vendor and no action is required at Wipro\'s end since we are reimbursing the vendor in accordance with the stipulation of minimum wages.', 'Karyawan kontrak berada dalam daftar gaji vendor dan tidak ada tindakan yang diperlukan Wipro karena vendor sesuai dengan ketentuan upah minimum.', 2, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL);
INSERT INTO `mst_cobc_question` (`question_id`, `question_text_eng`, `question_text_bhs`, `question_option_1_eng`, `question_option_1_bhs`, `question_option_2_eng`, `question_option_2_bhs`, `question_option_3_eng`, `question_option_3_bhs`, `question_answer`, `created_by`, `created_at`, `updated_by`, `updated_at`, `deleted_by`, `deleted_at`) VALUES
(44, 'A manager informs his team members that he will not be granting any leave applications until they meet their targets. This applies even in planned and emergency cases. In your view:', 'Seorang manajer memberi tahu anggota timnya bahwa dia tidak akan memberikan cuti apa pun sampai mereka memenuhi target mereka. Ini berlaku bahkan dalam kasus terencana dan darurat. Dalam pandangan Anda:', 'The manager is justified in doing so to achieve business targets.', 'Manajer dibenarkan melakukannya untuk mencapai target bisnis.', 'Manager should discuss with his team members on leave planning to ensure that there is no conflict with critical projects and reasonable leave utilization can happen. ', 'Manajer harus berdiskusi dengan anggota timnya tentang perencanaan cuti untuk memastikan bahwa tidak ada konflik dengan proyek penting dan pemanfaatan cuti yang wajar dapat diambil.', 'Even in the case of personal emergencies, the manager retains the authority to reject leave applications without any reasonable grounds.', 'Bahkan dalam keadaan darurat pribadi, manajer tetap memiliki wewenang untuk menolak permohonan cuti tanpa alasan yang masuk akal.', 2, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(45, 'One of the sub-contractors you have engaged uses child labour on his work site. You will:', 'Salah satu subkontraktor yang Anda libatkan menggunakan pekerja anak di lokasi kerjanya. Anda akan:', 'Escalate the matter to your supervisor or Ombudsperson.', 'Sampaikan masalah tersebut ke supervisor atau Ombudsman.', 'Encourage the sub-contractor and ask him to pass on the financial benefit to Wipro.', 'Dorong subkontraktor dan minta dia untuk memberikan keuntungan finansial kepada Wipro.', 'Ignore the incident as it is taking place outside Wipro premise.', 'Abaikan insiden tersebut karena terjadi di luar wilayah Wipro.', 1, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(46, 'An employee resigns from work. His manager is unhappy and threatens that his exit letter and full and final settlement will be withheld. Is the manager justified in doing so? ', 'Seorang karyawan mengundurkan diri dari pekerjaan. Manajernya tidak senang dan mengancam bahwa surat resign serta pembayaran hak akan ditahan. Apakah manajer dibenarkan untuk melakukannya?', 'This action of the manager is in the interest of the company and hence is justified.', 'Tindakan manajer ini adalah untuk kepentingan perusahaan dan karenanya dibenarkan.', 'Withholding of exit letter and full and final settlement as a threat to force the employee to stay on is not allowed as per Wipro\'s policies.', 'Penahanan surat resign dan penyelesaian hak akhir sebagai ancaman untuk memaksa karyawan tetap tinggal tidak diperbolehkan sesuai dengan kebijakan Wipro.', 'It is an acceptable measure to do so to retain the employee.', 'Ini adalah tindakan yang dapat diterima untuk melakukannya untuk mempertahankan karyawan.', 2, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(47, 'An employee who is on Maternity Leave for four months is considered ineligible for annual appraisal citing that she is absent. Your views:', 'Seorang karyawan yang sedang dalam Cuti Bersalin selama tiga bulan dianggap tidak memenuhi syarat untuk penilaian tahunan karena dia tidak hadir. Pandangan Anda:', 'This is the right approach as the employee has not worked for full year and hence cannot be appraised.', 'Ini adalah pendekatan yang tepat karena karyawan tersebut belum bekerja selama setahun penuh dan karenanya tidak dapat dinilai.', 'It will be unjust to other employees if appraisal is provided to employees on maternity leave.', 'Tidak adil bagi karyawan lain jika penilaian diberikan kepada karyawan saat cuti melahirkan.', 'Maternity leave is granted in accordance with the provisions of law. Per Wipro\'s policy, an employee on maternity leave should be eligible for annual appraisal for the period she is present at work. ', 'Pemberian cuti melahirkan sesuai dengan ketentuan peraturan perundang-undangan. Sesuai kebijakan Wipro, seorang karyawan yang sedang cuti melahirkan harus memenuhi syarat untuk penilaian tahunan selama dia berada di tempat kerja.', 3, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(48, 'You are aware of the fact that few of your colleagues are working part-time jobs for remuneration but only after office hours. You will:', 'Anda menyadari fakta bahwa beberapa kolega Anda bekerja paruh waktu untuk mendapatkan upah tetapi hanya setelah jam kerja. Anda akan:', 'Report to HR team as well as with Ombuds since part-time jobs while in employment with Wipro results in dual employment which is not permitted per company\'s policy and also results in conflict of interest.', 'Laporkan ke tim HR serta Ombuds karena pekerjaan paruh waktu selama bekerja di Wipro menghasilkan pekerjaan ganda yang tidak diizinkan menurut kebijakan perusahaan dan juga menimbulkan konflik kepentingan.', 'Endorse the part-time activity since in your view there is nothing wrong with pursuing such activities for financial gain since the activities are carried out after office hours.', 'Dukung aktivitas paruh waktu karena menurut Anda tidak ada salahnya mengejar aktivitas tersebut demi keuntungan finansial karena aktivitas tersebut dilakukan setelah jam kerja.', 'Seek support from such colleagues in order to pursue such part-time activities since it will also help you to gain financially.', 'Mencari dukungan dari kolega semacam itu untuk mengejar aktivitas paruh waktu karena itu juga akan membantu Anda memperoleh keuntungan secara finansial.', 1, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(49, 'You have credible information that the procurement manager seeks bribes and illegal favours from contractors during empanelment process. You will ', 'Anda memiliki informasi yang dapat dipercaya bahwa manajer procurement  meminta suap dan bantuan ilegal dari kontraktor selama proses seleksi. Anda akan', 'Immediately report the matter to HR department and Procurement Head to inquire into the matter and take necessary action against the manager.', 'Segera laporkan masalah tersebut ke departemen HRD dan Kepala Pengadaan untuk menanyakan masalah tersebut dan mengambil tindakan yang diperlukan terhadap manajer.', 'Ignore the finding since the Procurement manager also happens to be your supervisor and this will directly impact your career in the company.', 'Abaikan temuan karena Manajer Procurement juga merupakan supervisor Anda dan ini akan berdampak langsung pada karir Anda di perusahaan.', 'Seek a share in the bribe from the supervisor and if he refuses to share the spoils, threaten him with revealing the fraud to management.', 'Minta bagian/jatah dari hasil suap tersebut dan jika dia menolak untuk berbagi ancam dia dengan mengungkapkan penipuan kepada manajemen.', 1, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(50, 'Your manager\'s close relative is a core member of his team but he has not officially disclosed this fact to the company. You are aware of this fact. You will:', 'Kerabat dekat manajer Anda adalah anggota inti timnya, tetapi dia belum secara resmi mengungkapkan fakta ini kepada perusahaan. Anda menyadari fakta ini. Anda akan:', 'Ignore this fact since it is none of your concern and there is no need for you to get involved in the personal matters of your manager.', 'Abaikan fakta ini karena itu bukan urusan Anda dan Anda tidak perlu terlibat dalam masalah pribadi manajer Anda.', 'Bring this to the notice of your manager\'s supervisor and HR as in your view this is a matter which violates Wipro\'s policy on conflict of interest.', 'Sampaikan hal ini kepada supervisor dan HR manajer Anda karena menurut Anda ini adalah masalah yang melanggar kebijakan Wipro tentang konflik kepentingan.', 'Share the information with your friends but not escalate the issue.', 'Bagikan informasi dengan teman-teman Anda, tetapi jangan eskalasi masalahnya.', 2, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(51, 'Your manager requests for you to come to his residence after office hours and during weekends on the pretext of completing pending tasks. He has also dropped suggestive sexual hints. You will:', 'Manajer Anda meminta Anda untuk datang ke kediamannya setelah jam kerja dan selama akhir pekan dengan dalih menyelesaikan tugas yang tertunda. Dia juga memberikan tanda permintaan seksual . Anda akan:', 'Comply with the request of your manager in order to keep him happy and also to offer sexual favours to grow in the company irrespective of your performance and merits.', 'Patuhi permintaan manajer Anda untuk membuatnya bahagia dan juga menawarkan bantuan seksual agar bisa berkembang terlepas dari kinerja dan prestasi Anda.', 'You will politely decline such requests and instead will offer to complete the pending tasks independently. You will also warn the manager and inform that if such requests continue, you may raise an HR complaint on grounds of sexual harassment.', 'Anda akan dengan sopan menolak permintaan tersebut dan sebagai gantinya akan menawarkan untuk menyelesaikan tugas yang tertunda secara mandiri. Anda juga akan memperingatkan manajer dan menginformasikan bahwa jika permintaan tersebut berlanjut, Anda dapat mengajukan keluhan HR/Ombuds atas dasar pelecehan seksual.', 'You will succumb to the pressure of your manager even though you are against such acts but will not raise Ombuds complaint since it may adversely impact your career.', 'Anda akan menyerah pada tekanan manajer Anda meskipun Anda menentang tindakan tersebut tetapi tidak akan mengajukan keluhan Ombuds karena dapat berdampak buruk bagi karier Anda.', 2, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(52, 'Your colleague advises you to stay back in office late in order to claim taxi bills. You will:', 'Rekan Anda menyarankan Anda untuk tetap berada di kantor sampai larut malam untuk mengklaim tagihan taksi. Anda akan:', 'Follow your colleague\'s advice as this will help in saving transport money and get a comfortable ride back.', 'Ikuti saran rekan Anda karena ini akan membantu menghemat uang transportasi dan mendapatkan perjalanan pulang yang nyaman.', 'You will not only refuse to follow the advice as it is a breach of integrity but will also advise your colleagues not to involve in such unethical practice as it is a breach of integrity.', 'Anda tidak hanya akan menolak untuk mengikuti saran karena itu adalah pelanggaran integritas tetapi juga akan menasihati rekan Anda untuk tidak terlibat dalam praktik yang tidak etis karena itu adalah pelanggaran integritas.', 'Decline his advice but will not guide your colleague to stop doing so since it does not concern you.', 'Tolak nasihatnya tetapi tidak akan membimbing rekan Anda untuk berhenti melakukannya karena itu bukan urusan Anda.', 2, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(53, 'You noticed that your colleagues have making frequent requisition of office stationery and have been bringing the bulk of it back home for personal use. You will:', 'Anda memperhatikan bahwa rekan Anda sering meminta alat tulis kantor dan telah membawa sebagian besar kembali ke rumah untuk penggunaan pribadi. Anda akan:', 'Follow the practice since it is a trivial matter and nobody objects to it.', 'Ikuti prakteknya karena ini adalah masalah sepele dan tidak ada yang keberatan.', 'Refuse to follow the unethical practice but ignores the conduct of others involved in it since you are not in any manner involved in it.', 'Menolak untuk mengikuti praktik yang tidak etis tetapi mengabaikan perilaku orang lain yang terlibat di dalamnya karena Anda sama sekali tidak terlibat di dalamnya.', 'Report the matter against the persons involved in such practices to HR and Ombuds as it is an unacceptable practice being in violation of Wipro\'s controllership policy.', 'Laporkan masalah tersebut terhadap orang-orang yang terlibat dalam praktik semacam itu kepada HR dan Ombuds karena merupakan praktik yang tidak dapat diterima karena melanggar kebijakan pengendalian Wipro.', 3, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(54, 'You are aware of the fact that one of your colleague in the finance function was continuously harassed by Finance Head in public / private meetings and derogatory statements were made by the function head about his / her race and background. You will:', 'Anda mengetahui bahwa salah satu rekan Anda di bagian keuangan terus menerus dilecehkan oleh Finance Head di muka publik/ pribadi dan pernyataan yang menghina oleh Function Head  tentang ras dan latar belakangnya. Anda akan:', 'Encourage colleague to talk to Finance Head to stop such harassment practice and to treat all equal on merits. If the Finance Head continues with such practices, s/he should raise an Ombuds complaint against the him / her for workplace harassment. Alternatively you can report anoymously.', 'Dorong rekan Anda untuk  berbicara dengan Finance Head untuk menghentikan praktik pelecehan tersebut dan memperlakukan semua orang dengan setara berdasarkan prestasi. Jika Finance Head terus melakukan praktik semacam itu, dia harus mengajukan keluhan ke Ombuds terhadapnya atas pelecehan di tempat kerja. Cara lainnya, Anda dapat melaporkan secara anoym.', 'Ignore such practices since it is not adopted and practised against you and to allow the Finance Head to continue targeting few team members.', 'Abaikan praktik tersebut karena tidak diadopsi dan dipraktikkan terhadap Anda dan membiarkan Finance Head  terus menargetkan beberapa anggota tim.', 'Advise the harassed team member to accept the harassment and keep quiet if he/she wants to retain the job even if the insults are carried out regularly.', 'Sarankan anggota tim yang dilecehkan untuk menerima pelecehan tersebut dan tetap diam jika dia ingin mempertahankan pekerjaan tersebut meskipun penghinaan tersebut dilakukan secara terus menerus.', 1, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(55, 'You received credible confirmation that a particular employee has submitted false credentials pertaining to his professional experience, qualification and last drawn salary to get an employment in Wipro. You will:', 'Anda menerima konfirmasi yang dapat dipercaya bahwa karyawan tertentu telah mengirimkan kredensial palsu yang berkaitan dengan pengalaman profesionalnya, kualifikasi dan gaji terakhirnya untuk mendapatkan pekerjaan di Wipro. Anda akan:', 'Not take any action since the concerned employee is performing well and his leaving the company will bring extra work pressure on you.', 'Tidak mengambil tindakan apa pun karena karyawan yang bersangkutan berkinerja baik dan kepergiannya dari perusahaan akan memberikan tekanan kerja ekstra bagi Anda.', 'Share what you know with your colleagues but not escalated the matter.', 'Bagikan apa yang Anda ketahui dengan rekan Anda tetapi tidak memperjelas masalahnya.', 'Immediately bring it to the notice of the HR team as it is a misrepresentation of facts and falsification of report.', 'Segera sampaikan kepada tim HR karena ini adalah fakta yang keliru dan pemalsuan laporan.', 3, 'Husin', '2020-09-09 08:42:32', 'Husin', '2020-09-09 08:42:32', NULL, NULL),
(56, 'It is found by you that a senior manager is approving inflated cash claims for his team members and have also received kickbacks in the excess money received by the team members. You will:', 'Anda mengetahui bahwa seorang manajer senior menyetujui klaim uang tunai yang digelembungkan untuk anggota timnya dan juga telah menerima sogokan atas kelebihan uang yang diterima oleh anggota tim. Anda akan:', 'Not take any action on noticing such practice since the senior manager is not compelling you to either submit inflated bills or to share the excess claims with you.', 'Tidak mengambil tindakan apa pun saat memperhatikan praktik semacam itu karena manajer senior tidak memaksa Anda untuk mengajukan tagihan yang membengkak atau berbagi kelebihan klaim dengan Anda.', 'Immediately report against such practice to HR and Ombuds not only against the senior manager but also the team members who are involved in unethical conduct and financial impropriety.', 'Segera laporkan praktik semacam itu kepada HR dan Ombuds tidak hanya kepada manajer senior tetapi juga anggota tim yang terlibat dalam perilaku tidak etis dan ketidakwajaran keuangan.', 'Also participate in similar practice since it will also bring you extra financial benefit and you will be safe since others are also doing the same.', 'Ikut serta dalam praktik serupa karena ini juga akan memberi Anda keuntungan finansial tambahan dan Anda akan aman karena orang lain juga melakukan hal yang sama.', 2, 'Husin', '2020-09-09 08:42:33', 'Husin', '2020-09-09 08:42:33', NULL, NULL),
(57, 'You have won a small amount of gift vouchers through a lucky draw during the annual dinner and dance held by a Wipro vendor/ distributor. You will:', 'Anda telah memenangkan sejumlah kecil voucher hadiah melalui undian berhadiah selama makan malam dan dansa tahunan yang diadakan oleh vendor / distributor Wipro. Anda akan:', 'Inform the vendor/ distributor that you are not allowed to accept and decline acceptance.', 'Beri tahu vendor / distributor bahwa Anda tidak diizinkan untuk menerima dan menolak penerimaan.', 'Accept the prize on the spot but return it the next day.', 'Terima hadiahnya saat itu juga tetapi kembalikan keesokan harinya.', 'Accept the prize as lucky draw prizes does not construe as payment or consideration for influencing a business decision or action.', 'Terima hadiah karena hadiah undian tidak diartikan sebagai pembayaran atau pertimbangan untuk memengaruhi keputusan atau tindakan bisnis.', 3, 'Husin', '2020-09-09 08:42:33', 'Husin', '2020-09-09 08:42:33', NULL, NULL),
(58, 'You are visiting a supplier of Wipro in a remote location where no public transport is easily available. Supplier offers to arrange transportation at his cost. You will :', 'Anda mengunjungi suplier Wipro di lokasi terpencil di mana tidak ada transportasi umum yang tersedia dengan mudah. Suplier menawarkan untuk mengatur transportasi dengan biayanya. Anda akan :', 'Take office transport if it can be arranged. If not, accept the supplier\'s offer to arrange transportation but inform him that you will reimburse for the expenses incurred.', 'Gunakan transportasi kantor jika bisa diatur. Jika tidak, terima tawaran suplierk untuk mengatur transportasi tetapi beri tahu dia bahwa Anda akan mengganti biaya yang timbul.', 'Accept the offer and don\'t disclose to your Manager or HR.', 'Terima tawaran tersebut dan jangan mengungkapkannya kepada Manajer atau HRD Anda.', 'Accept the offer and ask for further support at supplier\'s cost as you are in a remote location.', 'Terima tawaran tersebut dan minta dukungan lebih lanjut dengan biaya pemasok karena Anda berada di lokasi terpencil.', 1, 'Husin', '2020-09-09 08:42:33', 'Husin', '2020-09-09 08:42:33', NULL, NULL),
(59, 'During festive seasons such as Chinese New Year or Mid Autumn Festival, you received a hamper from a supplier. You will:', 'Selama musim perayaan seperti Tahun Baru Imlek atau perayaan lebaran/natal. Anda menerima parcel dari Suplier. Anda akan:', 'Handover the hamper to the common gift pool which shall be either shared with all employees or added to the lucky draw pool for events such as Company dinner and dance event.', 'Serahkan parcel ke pool hadiah umum yang akan dibagikan dengan semua karyawan atau ditambahkan ke pool undian untuk acara seperti makan malam Perusahaan dan acara gathering.', 'Enjoy the hamper by yourself as the supplier has given it to you based on your working relationship with him.', 'Nikmati sendiri parcelnya karena suplier telah memberikannya kepada Anda berdasarkan hubungan kerja Anda dengannya.', 'Sell the hamper for a profit.', 'Jual parcel untuk mendapatkan keuntungan.', 1, 'Husin', '2020-09-09 08:42:33', 'Husin', '2020-09-09 08:42:33', NULL, NULL),
(60, 'You are doing a road show with an agency, during your interactions with them, you come to know that one of your colleague is a partner in that firm, You will:', 'Anda melakukan road show dengan agen, selama interaksi Anda dengan mereka, Anda mengetahui bahwa salah satu kolega Anda adalah mitra di perusahaan itu, Anda akan:', 'Work closely with the colleague to foster better working relationship with the agency in future collaboration.', 'Bekerja sama dengan kolega untuk membina hubungan kerja yang lebih baik dengan agensi dalam kolaborasi di masa mendatang.', 'Ignore the matter.', 'Abaikan saja', 'Raise a concern with the HR team as well as with Ombuds as there would be a potential conflict of interest.', 'Sampaikan kekhawatiran kepada tim HR serta Ombuds karena akan ada potensi konflik kepentingan.', 3, 'Husin', '2020-09-09 08:42:33', 'Husin', '2020-09-09 08:42:33', NULL, NULL),
(61, 'At the workplace, you have observed one of your colleague is involving in the Multi Level Marketing (MLM) business and is engaging with others colleagues to join in the MLM business, you will :', 'Di area kantor, anda melihat salah satu rekan kerja anda bergabung dengan MLM bisnis, dan melibatkan rekan kerja lainnya untuk bergabung dengan bisnis tersebut. Anda akan? :', 'Verify with the colleague whether the MLM business is related to Wipro\'s businesses or not. If not related, ignore the matter.', 'Memverifikasikan dengan rekan kerja apakah bisnis MLM terkait dengan bisnis Wipro atau tidak. Jika tidak terkait, abaikan saja.', 'Ignore the matter.', 'Abaikan saja', 'Raise a concern with the HR team as well as with Ombuds as it would deem as dual employment.', 'Sampaikan kekhawatiran ini kepada tim SDM serta Ombuds karena dapat dianggap sebagai pekerjaan ganda.', 3, 'Husin', '2020-09-09 08:42:33', 'Husin', '2020-09-09 08:42:33', NULL, NULL),
(62, 'There are evidences showing that one of the sales colleague is doing part time as a private hire driver (e.g. Grab / Uber). You should: ', 'Ada bukti yang menunjukan bahwa salah satu rekan sales bekerja paruh waktu sebagai supir pribadi atau ( Gojeg / Grab) anda akan ', 'Ignore the matter as it is not affecting the sales colleague\'s performance at work.', 'Abaikan saja, selagi itu tidak berdampak kepada performance bekerja dari rekan kerja tersebut.', 'Raise a concern with the HR team as well as with Ombuds since part-time jobs while in employment with Wipro results in dual employment which is not permitted per company\'s policy and also results in conflict of interest.', 'Sampaikan kekhawatiran ini kepada tim SDM serta Ombuds karena dapat dianggap sebagai bekerja paruh waktu. Dimana pekerja di Wipro tidak diizinkan untuk memiliki pekerjaan ganda, sesuai dengan peraturan perusahaan dan juga dapat memunculkan konflik kepentingan pribadi.', 'Advise the sales colleague to only take up ride during non-official work hours.', 'Menasehati rekan sales tersebut, untuk menerima orderan hanya di bukan jam kerja.', 2, 'Husin', '2020-09-09 08:42:33', 'Husin', '2020-09-09 08:42:33', NULL, NULL),
(63, 'A colleague has been baking at home during weekends and selling the items at nominal fee  to her friends during festive seasons. Your views:', 'Seorang rekan kerja telah membuat kue di rumah selama akhir pekan dan menjual barang dengan harga murah kepada teman-temannya. Pandanganmu', 'This is permissible, given that employee inform HR and obtain prior approval for this. It is not a conflict of interest as it is not a commercial pursuit of hobbies and interests which interferes with the employees ability to fulfill his or her responsibilities to Wipro.', 'Ini diperbolehkan, dengan catatan karyawan menginformasikan HR dan mendapatkan persetujuan sebelumnya untuk ini. Ini bukan konflik kepentingan selama bukan pengejaran hobi dan kepentingan komersial yang mengganggu kemampuan karyawan untuk memenuhi tanggung jawabnya kepada Wipro.', 'This is not permissable as there is conflict of interest and deemed as dual employment.', 'Hal ini tidak diperbolehkan karena dapat menimbulkan benturan kepentingan dan dianggap sebagai pekerjaan ganda.', 'This is  not permissible as the employee is selling her products to friends and colleagues.', 'Ini tidak diperbolehkan karena karyawan tersebut menjual produknya ke teman dan kolega.', 1, 'Husin', '2020-09-09 08:42:33', 'Husin', '2020-09-09 08:42:33', NULL, NULL),
(64, 'You observed that an outsourced employee is being offered a ride home daily by her Manager, and she has repeatedly turned down the offer and has shared that she is uncomfortable with the gestures. You should:', 'Anda melihat ada seorang karyawan outsourcing ditawari tumpangan pulang setiap hari oleh Manajernya, dan dia telah berulang kali menolak tawaran tersebut dan telah mengatakan bahwa dia tidak nyaman dengan ajakan tersebut. Anda harus:', 'Ignore the matter as she is an outsourced employee and you do not wish to offend the Manager.', 'Abaikan masalah ini karena dia adalah karyawan outsourcing dan Anda tidak ingin menyinggung Manajer.', 'Advise the outsourced employee to raise a concern with the HR team as well as with Ombuds. You can also choose to report anonymously.', 'Sarankan karyawan outsourcing untuk menyampaikan kekhawatirannya kepada tim SDM serta Ombuds. Anda juga dapat memilih untuk melaporkan secara anonim.', 'Share your observations with colleagues but do not escalate the matter.', 'Membagikan pengamatan anda, dengan rekan kerja lainnya tetapi tidak mengekskalasi permasalahan.', 2, 'Husin', '2020-09-09 08:42:33', 'Husin', '2020-09-09 08:42:33', NULL, NULL),
(65, 'During a department dinner to welcome new colleagues, your Manager repeatedly offered a colleague drinks, which she has rejected repeatedly. You should:', 'Selama acara makan malam untuk menyambut rekan kerja baru di Departement, Manager anda berulangkali menawarkan minuman kepada rekan kerja anda, dan dia telah menolak berulang kali. Anda harus :', 'Encourage the colleague to accept the drinks to avoid offending the Manager.', 'Mendorong rekan kerja anda menerima minuman tersebut, agar Manager tidak tersinggung', 'Santitize your Manager such actions can be seen are inappropriate. However if he repeatedly makes the colleague uncomfortable, you need to report the problem to HR or the Ombuds person.', 'Ingatkan Manager, bahwa tindakan seperti itu tidak pantas untuk dilihat. Namun jika dilakukan berulang kali dan membuat rekan kerja tersebut tidak nyaman, Anda perlu melaporkan masalah tersebut ke bagian SDM atau Ombuds.', 'Keep quiet as you do not wish offend the Manager.', 'Tidak melakukan apapun, karena anda tidak ingin menyinggung Manager', 2, 'Husin', '2020-09-09 08:42:33', 'Husin', '2020-09-09 08:42:33', NULL, NULL),
(66, 'You came across a recent post by your colleague on social media platform about the company practise. The content of the post raise negativity which may have the potential to adversely impact the company. You should:', 'Anda menemukan postingan terbaru di platform media sosial dibuat oleh rekan kerja anda, tentang praktik perusahaan. Isi postingan tersebut menimbulkan hal-hal negatif yang mungkin berpotensi merugikan perusahaan. Anda harus:', 'Like the post as you agree to it.', 'Menyukai postingan tersebut, sebagai tanda anda menyetujuinya.', 'Ignore the matter as it is your colleague\'s personal social media account.', 'Mengabaikannya karena postingan tersebut ada di media sosial pribadi rekan kerja anda.', 'Raise a concern with the HR team as well as with Ombuds.', 'Sampaikan kekhawatiran kepada tim HR serta Ombuds', 3, 'Husin', '2020-09-09 08:42:33', 'Husin', '2020-09-10 06:31:13', NULL, NULL),
(67, 'You saw a post by your colleague on social media platform ranting negatively about a customer that he is working with. You should:', 'Anda melihat postingan rekan Anda di platform media sosial yang berkomentar negatif tentang pelanggan yang bekerja dengannya. Anda harus:', 'Like the post as you agree to it.', 'Menyukai postingan tersebut, sebagai tanda anda menyetujuinya.', 'Ignore the matter as it is your colleague\'s personal social media account.', 'Mengabaikannya karena postingan tersebut ada di media sosial pribadi rekan kerja anda.', 'Raise a concern with the HR team as well as with Ombuds.', 'Sampaikan kekhawatiran kepada tim HR serta Ombuds', 3, 'Husin', '2020-09-09 08:42:33', 'Husin', '2020-09-09 08:42:33', NULL, NULL),
(68, 'As an individual, you have been actively sharing your knowledge and views on social media platforms and forums. You should:', 'Sebagai individu, Anda secara aktif membagikan pengetahuan dan pandangan Anda di platform dan forum media sosial. Anda harus', 'Indicate clearly a disclaimer that all contents and comments published are of personal views and not a representation of Wipro. ', 'Tunjukkan dengan penafsiran jelas bahwa semua konten dan komentar yang diterbitkan adalah pandangan pribadi dan bukan representasi dari Wipro.', 'Use successful stories in Wipro to help build the company\'s branding and reputation.', 'Membagikan kisah sukses di Wipro untuk membantu membangun merek dan reputasi perusahaan.', 'Use information of customers/suppliers as case reference when sharing on social media platforms and forum.', 'Gunakan informasi pelanggan / pemasok sebagai referensi kasus saat berbagi di platform dan forum media sosial.', 1, 'Husin', '2020-09-09 08:42:33', 'Husin', '2020-09-09 08:42:33', NULL, NULL),
(69, 'You are on business travel to a country you have not visited before and wish to extend your stay. You should:', 'Anda dalam perjalanan dinas ke Kota yang sebelumnya belum pernah Anda datangi, anda berminat untuk menambah hari disana. Anda Harus :', 'Obtain approval from Manager before extending the trip. All expenses under extended stay are not claimable. Air fare may be claimed in full or partial depending on conditions of extension.', 'Dapatkan persetujuan dari Manajer sebelum memperpanjang perjalanan. Semua biaya dalam perpanjangan masa tinggal tidak dapat diklaim. Tarif udara dapat diklaim seluruhnya atau sebagian tergantung pada ketentuan perpanjangan.', 'Obtain approval from Manager before extending the trip and claim all expenses under the extended stay under travel expenses.', 'Dapatkan persetujuan dari Manajer sebelum memperpanjang perjalanan dan klaim semua biaya di bawah perpanjangan masa tinggal di bawah biaya perjalanan.', 'Extend the trip without notifying Manager and claim all expenses under travel expenses since you are there on work purpose from the start. ', 'Perpanjang perjalanan tanpa memberi tahu Manajer dan klaim semua biaya di bawah biaya perjalanan karena Anda berada di sana untuk tujuan kerja.', 1, 'Husin', '2020-09-09 08:42:33', 'Husin', '2020-09-09 08:42:33', NULL, NULL),
(70, 'Workplace is not limited to just the stated work office employees are located at. Which of the following statement is incorrect?', 'Tempat kerja tidak terbatas hanya pada ruang kerja kantor dimana karyawan ditempatkan. Manakah dari pernyataan berikut yang salah?', 'Road show venues constitutes as an extension of workplace as it is a location where work related event is held at.', 'Tempat road show merupakan perpanjangan dari tempat kerja karena merupakan tempat diadakannya acara terkait pekerjaan.', 'Dinner venue for offical business meeting with vendor is not considered as workplace as it is after office hours.', 'Tempat makan malam untuk pertemuan bisnis resmi dengan vendor tidak dianggap sebagai tempat kerja ketika setelah jam kerja.', 'When on business travel, the place of stay is also deemed as a workplace as it is part of work requirement for the travel.', 'Saat dalam perjalanan bisnis, tempat tinggal juga dianggap sebagai tempat kerja karena merupakan bagian dari persyaratan kerja selama perjalanan.', 2, 'Husin', '2020-09-09 08:42:33', 'Husin', '2020-09-09 08:42:33', NULL, NULL),
(71, 'Your promoter has shared that his outlet owner has been requesting him to send her home after work, or she will feedback to Manager/ Company that he is not performing his work . Your colleague should:', 'Promotor Anda telah memberi tahu bahwa pemilik outletnya meminta  untuk diantarkan pulang setelah bekerja, atau dia akan memberi laporan kepada Manajer / Perusahaan bahwa anda tidak melakukan pekerjaannya. Rekan kerja  Anda harus:', 'Accept the request to avoid offending the outlet owner.', 'Menerima permintaan tersebut, agar tidak menyinggung pemilik outlet.', 'Avoid the outlet owner and request for a change of outlet.', 'Menghindar dari pemilik outlet, dan meminta untuk perubahan outlet.', 'Raise a concern with his Manager and the HR team as well as with Ombuds.', 'Sampaikan kekhawatiran ini kepada team HR serta Ombuds.', 3, 'Husin', '2020-09-09 08:42:33', 'Husin', '2020-09-09 08:42:33', NULL, NULL),
(72, 'One of your co-workers sends emails containing jokes and derogatory comments about certain nationalities, no one else has spoken up about this. What should you do?', 'Salah satu rekan kerja Anda mengirim email berisi lelucon dan komentar menghina tentang kebangsaan tertentu, tidak ada orang lain yang berbicara tentang ini. Apa yang harus Anda lakukan?', 'Send to email to your personal email account and share it with others.', 'Kirim ke akun email pribadi anda, dan bagikan dengan yang lain.', 'Notify the Manger or the HR team as such comments are of discriminating content and in conflict with Wipro COBCE policy. ', 'Beri tahu Manajer atau tim SDM karena komentar tersebut berisi konten yang diskriminatif dan bertentangan dengan kebijakan Wipro COBCE.', 'Ignore the matter as it is not targeted at any particular individual.', 'Abaikan masalah ini karena tidak ditujukan kepada individu tertentu.', 2, 'Husin', '2020-09-09 08:42:33', 'Husin', '2020-09-09 08:42:33', NULL, NULL),
(73, 'You have receive 2 gifts of <US$ 50 for the same occasion from supplier. You should:', 'Anda telah menerima 2 hadiah sebesar <US $ 50 dikesempatan yang sama dari pihak ketiga. Anda harus:', 'Raise the issue with Manager and the HR team to engage the supplier to make clear of Wipro\'s COBCE policy on Gifts and Business courtesies.', 'Angkat masalah dengan Manajer dan tim SDM untuk melibatkan pemasok untuk menjelaskan kebijakan COBCE Wipro tentang pemberian Hadiah dan Bisnis.', 'Accept both gifts and request the supplier to keep it to maximum 2 gifts per year.', 'Terima kedua hadiah tersebut dan minta pemasok untuk memberikan hadiah maksimal 2 hadiah per tahun.', 'Accept both gifts as the value is within acceptable limit.', 'Terima kedua hadiah tersebut, karena nilainya masih dalam batas hadiah yang dapat diterima.', 1, 'Husin', '2020-09-09 08:42:33', 'Husin', '2020-09-09 08:42:33', NULL, NULL),
(74, 'You noticed that 2 colleagues of yours has been swiping attendance for each other when one of them is late for work. You should:', 'Anda melihat bahwa 2 rekan kerja Anda saling bertukar absensi saat salah satu dari mereka terlambat masuk kerja. Anda harus:', 'Ignore the matter since it does not concern you.', 'Abaikan saja, itu bukan urusan anda.', 'Raise a concern with Manager and the HR team or with Ombuds.', 'Sampaikan kekhawatiran ini kepada team HR serta Ombuds.', 'Get them to include you in their act of swiping attendance on behalf when you are late for work.', 'Meminta mereka untuk menyertakan Anda dalam tindakan tersebut.', 2, 'Husin', '2020-09-09 08:42:33', 'Husin', '2020-09-09 08:42:33', NULL, NULL),
(75, 'A colleague brought home from office a thumb drive containing some customer information so he could work on it at home on his own computer. He didnt download the data and delete the data after completing his work the next day. Your view:', 'Seorang rekan kerja membawa Hard Disk yang berisi beberapa informasi pelanggan sehingga dia dapat mengerjakannya di rumah dengan komputernya sendiri. Dia tidak mendownload data dan menghapus data tersebut setelah menyelesaikan pekerjaannya keesokan harinya. Pandangan Anda:', 'The colleague did not download any data so it is not an issue of concern.                                                                                                                                                                                                                                                                                                                                                                                    ', 'Rekan kerja tidak mengunduh data apapun jadi ini bukan masalah yang menjadi perhatian', 'He should just send the material to his personal email instead of copying on a thumb drive. This prevent the leak of information should he lose the thumb drive. ', 'Dia sebaiknya mengirim materi ke email pribadinya alih-alih menyalinnya di Hard Disk. Ini mencegah kebocoran informasi jika dia kehilangan Hard Disk.', 'Not take the material by either transferring to personal email ID or through thumb drive since it will violate Wipro\'s confidentiality policy.', 'Tidak mengambil materi baik dengan mentransfer ke ID email pribadi atau melalui Hard Disk karena akan melanggar kebijakan kerahasiaan Wipro.', 3, 'Husin', '2020-09-09 08:42:33', 'Husin', '2020-09-09 08:42:33', NULL, NULL);
